description:
Figured I would upload this since the official &quot;****&quot; aka Live in Phoenix only has 15 tracks, and the DVD actually has 22 songs, plus 5 Intermissions/Encore stuff.

Ripped using DVD Audio Extractor to 192kbps mp3s.

